# Vertex AI - 解讀視頻對象跟蹤模型的預測結果
以下示例是在視頻中跟蹤貓和狗的模型的預測結果。每個結果都包含所跟蹤對象的標籤（ `cat` 或 `dog` ）、指定所跟蹤對象的時間和跟蹤時長的時間細分，以及描述對象位置的邊界框。
**注意** ：以下 JSON 行示例包含換行符便於閱讀。在您的 JSONL 行文件中，請僅在每個 JSON 對象後添加換行符。
```
{
 "instance": {
 "content": "gs://bucket/video.mp4",
 "mimeType": "video/mp4",
 "timeSegmentStart": "1s",
 "timeSegmentEnd": "5s"
 }
 "prediction": [{
 "id": "1",
 "displayName": "cat",
 "timeSegmentStart": "1.2s",
 "timeSegmentEnd": "3.4s",
 "frames": [{
  "timeOffset": "1.2s",
  "xMin": 0.1,
  "xMax": 0.2,
  "yMin": 0.3,
  "yMax": 0.4
 }, {
  "timeOffset": "3.4s",
  "xMin": 0.2,
  "xMax": 0.3,
  "yMin": 0.4,
  "yMax": 0.5,
 }],
 "confidence": 0.7
 }, {
 "id": "1",
 "displayName": "cat",
 "timeSegmentStart": "4.8s",
 "timeSegmentEnd": "4.8s",
 "frames": [{
  "timeOffset": "4.8s",
  "xMin": 0.2,
  "xMax": 0.3,
  "yMin": 0.4,
  "yMax": 0.5,
 }],
 "confidence": 0.6
 }, {
 "id": "2",
 "displayName": "dog",
 "timeSegmentStart": "1.2s",
 "timeSegmentEnd": "3.4s",
 "frames": [{
  "timeOffset": "1.2s",
  "xMin": 0.1,
  "xMax": 0.2,
  "yMin": 0.3,
  "yMax": 0.4
 }, {
  "timeOffset": "3.4s",
  "xMin": 0.2,
  "xMax": 0.3,
  "yMin": 0.4,
  "yMax": 0.5,
 }],
 "confidence": 0.5
 }]
}
``
